  false,\n\t\"url\": null,\n\t\"notes\": \"The gravity station data (1,037 records)
  were compiled by Doctor Stierman. This data base was received in June 1992. Principal
  gravity parameters include Free-Air Anomalies and both Simple Bouguer Anomalies
  (no terrain correction applied), and Complete Bouguer Anomalies (a terrain correction
  has been applied). The observed gravity values are referenced to the U.S.G.S. gravity
  base station network or to the State of Ohio gravity base station network. The 1930
  International Gravity Formula was used to calculate theoretical gravity. The data
  are randomly distributed within north western Ohio and a portion of northwestern
  West Virginia.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
